import java.util.*;public class Main{    public static void main(String [] args) {        Scanner sc = new Scanner(System.in);        int n = sc.nextInt();        Map<Integer,Integer> A = new HashMap<>();        for(int i=0;i<n;i++){            int num = sc.nextInt();            A.put(num,num);        }        int m = sc.nextInt();        for(int i=0;i<m;i++){            int num = sc.nextInt();            if(A.get(num)!=null) A.remove(num);        }        ArrayList<Integer> key = new ArrayList<>(A.keySet());        Collections.sort(key);        for(int i=0;i<key.size();i++) System.out.println(A.get(key.get(i)));    }}